import React, { useEffect, useState } from 'react';
import PropTypes from 'prop-types';
import { useNavigate } from 'react-router-dom';
import LeftBar from '../../component/leftbar/leftbar';
import { makeStyles } from '@material-ui/core/styles';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  AppBar,
  Tabs,
  Tab,
  Box,
  Menu,
  MenuItem
} from '@material-ui/core';
import './myprograme.css';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          {children}
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function Myprograme() {
  const classes = useStyles();
  const [value, setValue] = useState(0);
  const [value2, setValue2] = useState(0);
  const [anchorEl, setAnchorEl] = useState(null);
  const navigate = useNavigate();

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChange2 = (event, newValue) => {
    setValue2(newValue);
  };

  const renderMenuItems = () => {
    return (
      <Menu
        id="simple-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose}>withdraw</MenuItem>
        <MenuItem onClick={handleClose}>suspend</MenuItem>
        <MenuItem onClick={handleClose}>enroll</MenuItem>
      </Menu>
    );
  };

  const renderTableRows = () => {
    const studentModules = [
      { id: 1, module: 'Mathematics', credits: 3, grade: 'A' },
      { id: 2, module: 'Physics', credits: 4, grade: 'B' },
      { id: 3, module: 'History', credits: 3, grade: 'C' },
      { id: 4, module: 'Computer Science', credits: 5, grade: 'A' },
    ];

    return studentModules.map(module => (
      <TableRow key={module.id}>
        <TableCell align="center">{module.id}</TableCell>
        <TableCell align="center">{module.module}</TableCell>
        <TableCell align="center">start time</TableCell>
        <TableCell align="center">end time</TableCell>
        <TableCell align="center">{module.grade}</TableCell>
        <TableCell align="right">
          <Button
            variant="contained"
            color="primary"
            aria-controls="simple-menu"
            aria-haspopup="true"
            onClick={handleClick}
          >
            Actions
          </Button>
          {renderMenuItems()}
        </TableCell>
      </TableRow>
    ));
  };

  return (
    <div className='container' id='MyPrograme'>
      <div className='leftbox'>
        <LeftBar tabNav="MyPrograme" />
      </div>
      <div className='maincenter'>
        <AppBar position="static">
          <Paper square>
            <Tabs
              value={value}
              onChange={handleChange}
              indicatorColor="secondary"
              textColor="secondary"
            >
              <Tab label="Year 1" />
              <Tab label="Year 2" />
              <Tab label="Year 3" />
              <Tab label="Year 4" />
            </Tabs>
          </Paper>
        </AppBar>

        <TabPanel value={value} index={0}>
          <div className='tabbox'>
            <TableContainer className='tablebox'>
              <Table aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell align="center">ID</TableCell>
                    <TableCell align="center">Module Name</TableCell>
                    <TableCell align="center">start time</TableCell>
                    <TableCell align="center">end time</TableCell>
                    <TableCell align="center">grade</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {renderTableRows()}
                </TableBody>
              </Table>
            </TableContainer>
          </div>
        </TabPanel>

        {/* Other tab panels go here */}

      </div>
    </div>
  );
}

export default Myprograme;
